      "import Component from '@ember/component';\n\nconst dataSource = {\n  data: null,\n  caption: {\n    text: 'Web visits & downloads'\n  },\n  subcaption: {\n    text: 'since 2015'\n  },\n  yAxis: [\n    {\n      plot: [\n        {\n          value: 'Downloads',\n          type: 'column'\n        },\n        {\n          value: 'Web Visits',\n          type: 'line'\n        }\n      ]\n    }\n  ]\n};\n\nconst jsonify = res => res.json();\n// This is the remote url to fetch the data.\nconst dataFetch = fetch(\n  'https://s3.eu-central-1.amazonaws.com/fusion.store/ft/data/column-line-combination-data.json'\n).then(jsonify);\nconst schemaFetch = fetch(\n  'https://s3.eu-central-1.amazonaws.com/fusion.store/ft/schema/column-line-combination-schema.json'\n).then(jsonify);\n\nexport default Component.extend({\n  width: 600,\n  height: 400,\n  type: 'timeseries',\n  dataFormat: null,\n  dataSource: null,\n\n  init() {\n    this._super(...arguments);\n    this.set('dataFormat', 'json');\n    this.createDataTable();\n  },\n\n  createDataTable() {\n    Promise.all([dataFetch, schemaFetch]).then(res => {\n      const data = res[0];\n      const schema = res[1];\n      // First we are creating a DataStore\n      const fusionDataStore = new FusionCharts.DataStore();\n      // After that we are creating a DataTable by passing our data and schema as arguments\n      const fusionDataTable = fusionDataStore.createDataTable(data, schema);\n      // Afet that we simply mutated our timeseries datasource by attaching the above\n      // DataTable into its data property.\n      dataSource.data = fusionDataTable;\n      this.set('dataSource', dataSource);\n    });\n  }\n});",
